import React from "react";
import PropTypes from "prop-types";
import withStyles from "@material-ui/core/styles/withStyles";
import Close from "@cvccorp-components/icons/dist/Close";
import Box from "../Box";
import Typography from "../Typography";
import IMG from "../assets/img/download-app.png";
import { styles } from "./styles";

const DownloadApp = ({ classes, href }) => {
    return (
        <Box className={classes.root}>
            <a href={href} className={classes.link}>
                <img className={classes.img} src={IMG} alt="" />
                <Typography className={classes.text} type="body2semibold">
          Baixe o app da Submarino Viagens e receba ofertas exclusivas
                </Typography>
                <Close className={classes.close} size="medium" />
            </a>
        </Box>
    );
};

DownloadApp.propTypes = {
    classes: PropTypes.object.isRequired,
    href: PropTypes.string.isRequired,
};

export default withStyles(styles, { withTheme: true })(DownloadApp);
